public:
    int reverse(int x) {
        if (0 == x) {
            return 0;
        }
        int sign = x > 0? 1 : -1;
        int res = 0;
        while (x!= 0) {
            int rem = x % 10;
            res = res * 10 + rem;
            x /= 10;
        }
        return res * sign;
    }
};
