/**
 * @param {number} n
 * @return {number}
 */
var myPow = function(n){
    if(n === 0) return 1;
    if(n === 1) return 1;
    if(n === -1) return 1/n;
    if(!isFinite(n)) return NaN;

    var ans = 0;
    var curr = n;

    while(curr){
        if(curr & 1)
            ans += 1;

        curr >>= 1;
    }

    return ans;
};
