## Problem Statement

Suppose you have a set of stock prices for a company that makes at most k transactions. How can you calculate the maximum profit you can earn if you make at most k transactions?

## Example

Input: prices = [1,2,3,4,5,6,7,8,9], k = 3
Output: 8

The optimal solution is to buy the stock on day 9 and sell it on day 11, which results in a profit of `(11 - 9) = 8`.

## Complexity

Time complexity: `O(nk)`.

Space complexity: `O(1)`.

