bool subsetSum(std::vector<int> &v, int n, int sum) {
    bool dp[n+1][sum+1];
    memset(dp, false, sizeof(dp));

    dp[0][0] = true;

    for (int i = 1; i <= n; ++i) {
        for (int j = 1; j <= sum; ++j) {
            if (v[i-1] > j) {
                dp[i][j] = dp[i-1][j];
            } else {
                dp[i][j] = dp[i-1][j] || dp[i-1][j-v[i-1]];
            }
        }
    }

    return dp[n][sum];
}

